<!doctype html>
<html lang="en">
    <head>
        <meta charset="utf-8">
        <meta http-equiv="X-UA-Compatible" content="IE=edge">
        <meta name="viewport" content="initial-scale=1,user-scalable=no,maximum-scale=1,width=device-width">
        <meta name="mobile-web-app-capable" content="yes">
        <meta name="apple-mobile-web-app-capable" content="yes">
        <link rel="stylesheet" href="css/leaflet.css">
        <link rel="stylesheet" href="css/qgis2web.css"><link rel="stylesheet" href="css/fontawesome-all.min.css">
        <style>
        #map {
            width: 1440px;
            height: 900px;
        }
        </style>
        <title></title>
    </head>
    <body>
        <div id="map">
        </div>
        <script src="../js/leaflet.js"></script>
        <script src="../js/qgis2web_expressions.js"></script>
        <script src="../js/leaflet.rotatedMarker.js"></script>
        <script src="../js/leaflet.pattern.js"></script>
        <script src="../js/leaflet-hash.js"></script>
        <script src="../js/Autolinker.min.js"></script>
        <script src="../js/rbush.min.js"></script>
        <script src="../js/labelgun.min.js"></script>
        <script src="../js/labels.js"></script>
        <script src="data/starbucks_1.js"></script>
        <script>
        var map = L.map('map', {
            zoomControl:true, maxZoom:18, minZoom:2
        }).setView([47.6102552, -122.3463321], 18);
        var hash = new L.Hash(map);
        map.attributionControl.addAttribution('<a href="https://github.com/tomchadwin/qgis2web" target="_blank">qgis2web</a>');
        var bounds_group = new L.featureGroup([]);
        function setBounds() {
        }
        var overlay_MapSurferOSMRoadsGrayscale_0 = L.tileLayer('http://korona.geog.uni-heidelberg.de/tiles/roadsg/x={x}&y={y}&z={z}', {
            opacity: 1.0
        });
        overlay_MapSurferOSMRoadsGrayscale_0.addTo(map);
        map.addLayer(overlay_MapSurferOSMRoadsGrayscale_0);
        function pop_starbucks_1(feature, layer) {
            var popupContent = '<table>\
                    <tr>\
                        <td colspan="2">' + (feature.properties['name'] !== null ? Autolinker.link(String(feature.properties['name'])) : '') + '</td>\
                    </tr>\
                </table>';
            layer.bindPopup(popupContent, {maxHeight: 400});
        }

        function style_starbucks_1_0() {
            return {
                pane: 'pane_starbucks_1',
                radius: 24.0,
                stroke: false,
                fill: true,
                fillOpacity: 1,
                fillColor: 'rgba(196,120,72,0.2534901960784314)',
            }
        }
        map.createPane('pane_starbucks_1');
        map.getPane('pane_starbucks_1').style.zIndex = 401;
        map.getPane('pane_starbucks_1').style['mix-blend-mode'] = 'normal';
        var layer_starbucks_1 = new L.geoJson(json_starbucks_1, {
            attribution: '<a href=""></a>',
            pane: 'pane_starbucks_1',
            onEachFeature: pop_starbucks_1,
            pointToLayer: function (feature, latlng) {
                var context = {
                    feature: feature,
                    variables: {}
                };
                return L.circleMarker(latlng, style_starbucks_1_0(feature));
            },
        });
        bounds_group.addLayer(layer_starbucks_1);
        map.addLayer(layer_starbucks_1);
        setBounds();
        </script>
    </body>
</html>
